import React from 'react'
import WeatherSearch from './WeatherSearch'


let WeatherData = ({weather, cityname}) => {
    console.log(weather)
    console.log(cityname)
    let {tepm, humidity, pressure} = weather;
    return (
        <div className="weather-data">
            {/* <p className="weather__tagline">Weather forecast for <span className="weather-data__city">{props.city_name}</span></p> */}
            <div className="weather-data__box">
                <span className="weather-data__property">
                    <p className="weather-data__title">Temperature</p>
                    {/* <p className="weather-data__value">{props.weather.temp}</p> */}
                </span>
                <span className="weather-data__property">
                    <p className="weather-data__title">Humidity</p>
                    {/* <p className="weather-data__value">{props.weather.humidity}</p> */}
                </span>
                <span className="weather-data__property">
                    <p className="weather-data__title">Pressure</p>
                    {/* <p className="weather-data__value">{props.weather.pressure}</p> */}
                </span>
            </div>
        </div>
    )
}


export default WeatherData
